const Reducer = (state, action) => {
	switch (action.type) {
		case 'UPDATE_ERROR':
			action.payload.forEach((element) => {
				state.push(element)
			})
			let rs = action.payload
			return rs
		default:
			return [...state]
	}
}
export default Reducer
